let city = ["delhi", "Noida", "Jaunpur"];
let images = [
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR30tP9Be8wwqUv-SsSoOLND4WPvuyT6hRgAQ&s",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,"
];
let spn = document.querySelector("span");
let bdy = document.querySelector("body");

async function callCity() {
    for (let i = 0; i < city.length; i++) {
        await new Promise(resolve => setTimeout(resolve, 3000));
        spn.textContent = city[i];
        bdy.style.backgroundImage = `url('${images[i]}')`;
    }
}
callCity();
